    super(props);
    this.state = {gridBounds:{} };
  }
  render(){
    return (
      <div className="App">
      <InputGroup className="mb-3">
      <InputGroup.Prepend>
        <InputGroup.Text id="basic-addon1">Grid</InputGroup.Text>
      </InputGroup.Prepend>
      <FormControl
        placeholder="Username"
        aria-label="Username"
        aria-describedby="basic-addon1"
      />

    </InputGroup>
      </div>
    );
  }

}
